import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/App';
import reportWebVitals from './reportWebVitals';
import axios from 'axios';
import reducers from './reducers'
import {Provider} from 'react-redux'
import {createStore} from 'redux'
import createSagaMiddlware from 'redux-saga'
import {applyMiddleware} from 'redux'
import rootSaga from './sagas'
import 'bootstrap/dist/css/bootstrap.min.css'
axios.defaults.withCredentials = true;
axios.defaults.baseURL = 'http://rem-rest-api.herokuapp.com/api/';

// in case the above doesn't work for any reason, try this before editing anything else
//axios.defaults.withCredentials = true; <-- keep me commented
// axios.defaults.baseURL = 'https://cors-anywhere.herokuapp.com/https://rem.dbwebb.se/api';
const sagaMiddleware = createSagaMiddlware();

const store = createStore(reducers, applyMiddleware(sagaMiddleware));

sagaMiddleware.run(rootSaga);

ReactDOM.render(
  <React.StrictMode>
  <Provider store = {store}>
    <App />
  </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
